import React, { useEffect, useState } from "react";
import SideBarComponent from "../components/SideBarComponent";
import RecipeSearchComponent from "../components/RecipeSearchComponent";
import AvatarIcon from "../images/user-icon.png";

function UserDashboard() {
  //User Dashboard States

  const [recipes, setRecipies] = useState(null);

  useEffect(() => {
    const fectchRecipes = async () => {
      const response = await fetch("http://localhost:8000/api/recipes");
      const json = await response.json();

      if (!response.ok) {
        console.error(`Failed to fetch recipes. Status: ${response.status}`);
        return;
      }
      if (response.ok) {
        setRecipies(json);
      }
    };

    fectchRecipes();
  }, []);
